INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 2, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, "春咲 ひより", 0, 1, 1.4, "お！\nあそこに困ってそうな人発見！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 2, 0, "みんなみたいに\nわたしも強くならなきゃ", 1002, "草野 優衣", 0, 1, 1.4, "大切な人を\n守れるようになりたい…って", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "少しは磨かれると思いますよ。", 0, 1, 2, 0, "フェンシングを始めてみては？", 1003, "士条 怜", 0, 1, 1.4, "キミに必要な集中力と感性が", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 2, 0, "ねぇ、にいちゃん！", 1004, "穂高 みそぎ", 0, 1, 1.5, "今日はなにして遊ぶ？", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "私といっしょに…\nいかない？", 0, 1, 2, 0, "風宮あかりです", 1006, "風宮 あかり", 0, 1, 1.4, "ねぇ…", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "食べ物の恨みは怖いのー", 0, 1, 2, 0, "出雲宮子なのー", 1007, "出雲 宮子", 0, 1, 1.5, "プリンたべたいのー", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "いいよ。\n見られることは運命さ…", 0, 1, 2, 0, "ボクは虹村雪。", 1008, "虹村 雪", 0, 1, 1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "人呼んで「疾風の冥姫」!!", 0, 1, 2, 0, "フッ…聞いて後悔するがいい！", 1009, "柊杏奈", 0, 1, 1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ほんまおおきにやわ～♪", 0, 1, 2, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, "姫宮 真歩", 0, 1, 1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ここで会ったが\n100年目～！", 0, 1, 2, 0, "衣之咲璃乃です！", 1011, "衣之咲 璃乃", 0, 1, 1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 2, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, "柏崎 初音", 0, 1, 1.4, "ち、超能力って…\n何のことかな～？", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 2, 0, "ちょす！\n美波鈴奈だよ～♪", 1016, "美波 鈴奈", 0, 1, 1.4, "一応カリスマ読モJKやってまっす！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "でも、沖縄もとってもいいとこさー", 0, 1, 2, 0, "はいたーい。\n喜屋武香織さー。", 1017, "喜屋武 香織", 0, 1, 1.4, "東京は遊園地みたいなところさー", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "イオちゃんって呼んでね。", 0, 1, 2, 0, "支倉伊緒です。", 1018, "支倉 伊緒", 0, 1, 1.4, "先生って呼ばれるのは\nくすぐったいから", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ミミをおいてかないでぇ～", 0, 1, 2, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, "茜 ミミ", 0, 1, 1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ふぇぇぇぇぇん……", 0, 1, 2, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, "栗林 くるみ", 0, 1, 1.5, "あの……\nふぇ……", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "なんてありがとうございます！", 0, 1, 2, 0, "風宮よりです。\nあああああ！", 1022, "風宮 より", 0, 1, 1.4, "こんな私に貴重な時間を\n割いていただき、", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "私こっち行きたいー\nね、早く早くー", 0, 1, 2, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, "北条 綾音", 0, 1, 1.5, "おにいちゃんどこいくの？\nえ？", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "これて何か違う…\nあああすみません！", 0, 1, 2, 0, "わっ…わっ…私、\n天野すずめといいます！", 1025, "天野 すずめ", 0, 1, 1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "離しませんわ………\n絶対に…!!", 0, 1, 2, 0, "……クスクス…私は\n…倉石恵理子……", 1027, "倉石 恵理子", 0, 1, 1.4, "あなたは…運命の……\n伴侶……", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "…そうでしょ？？", 0, 1, 2, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, "佐々木 咲恋", 0, 1, 1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "あはは、\n私もまだまだだなぁ～", 0, 1, 2, 0, "桜井望だよ！\nよろしくねっ", 1029, "桜井 望", 0, 1, 1.4, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 2, 0, "デケデケデンっ！", 1030, "ニノン・ジュベール", 0, 1, 1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "おかしいですね……", 0, 1, 2, 0, "上喜しのぶです。\n手元のドクロが父です。", 1031, "上喜 しのぶ", 0, 1, 1.4, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 2, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, "野戸まひる", 0, 1, 1.5, "けんども\nそれには足りないモンが…", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ちょ\nちょっと一杯飲んできます…！", 0, 1, 2, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, "綾瀬 ゆかり", 0, 1, 1.4, "ちょっと緊張しちゃって…", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "これ以上お話しすることは…\nないです！", 0, 1, 2, 0, "氷川鏡華…です", 1036, "氷川 鏡華", 0, 1, 1.5, "知らない人とは話しちゃいけないので", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 2, 0, "柏崎…栞です。", 1038, "柏崎 栞", 0, 1, 1.4, "……あ、アラーム。", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "野に咲く花が、\n唯一の話相手です。", 0, 1, 2, 0, "ふ、双葉碧です。", 1040, "双葉 碧", 0, 1, 1.4, "私、一人も友達がいなくて……", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そう思っています。", 0, 1, 2, 0, "三角千歌です。", 1042, "三角 千歌", 0, 1, 1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "う、疑ってすまなかったな…", 0, 1, 2, 0, "安芸真琴だ。", 1043, "安芸 真琴", 0, 1, 1.4, "あぁ？\nお前のそいつの仲間か？", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 2, 0, "わらわこそは夜を総べる者！", 1044, "イリヤ・オーンスタイン", 0, 1, 1.4, "生けとし生ける全ての者よ！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ｌク、クウカに何かご用ですか!?", 0, 1, 2, 0, "そこで騎士は妖精を乱暴に……", 1045, "遠見 空花", 0, 1, 1.4, "ぐふふふふ……はっ！", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 2, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, "宮坂たまき", 0, 1, 1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 2, 0, "大神美冬よ！", 1048, "大神 美冬", 0, 1, 1.4, "それでは早速クエストに…", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 2, 0, "星野静流だよ！", 1049, "星野静流", 0, 1, 1.4, "クエストもバトルも\n掃除も洗濯も", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 2, 0, "アタシは玉泉美咲。", 1050, "玉泉美咲", 0, 1, 1.5, "見ての通りの\nセクシー美少女で", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "？？？？", 0, 1, 2, 0, "？？？", 1052, "リマ", 0, 1, 1.4, "？？？？", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 0, 1, 2, 0, "モニカ・ヴァイスヴィントだ。", 1053, "モニカ・ヴァイスヴィント", 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 0, 1, 2, 0, "モニカ・ヴァイスヴィントだ。", 1058, "ペコリーヌ", 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 0, 1, 2, 0, "モニカ・ヴァイスヴィントだ。", 1059, "コッコロ", 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 0, 1, 2, 0, "モニカ・ヴァイスヴィントだ。", 1060, "キャル", 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
